}

protected Element createContent(WebSession s) {
    ElementContainer ec = new ElementContainer();
    if (s.getRequest().getMethod().equalsIgnoreCase("POST")) {
        makeSuccess(s);
    }
    String lineSep = System.getProperty("line.separator");
    String script = "<script>" + lineSep + "function validate() {" + lineSep + "var keyField = document.getElementById(\'key\');" + lineSep + "var url = \'" + getLink() + "&from=ajax&key=\' + encodeURIComponent(keyField.value);" + lineSep + "if (typeof XMLHttpRequest != \'undefined\') {" + lineSep + "req = new XMLHttpRequest();" + lineSep + "} else if (window.ActiveXObject) {" + lineSep + "req = new ActiveXObject(\'Microsoft.XMLHTTP\');" + lineSep + "   }" + lineSep + "   req.open(\'GET\', url, true);" + lineSep + "   req.onreadystatechange = callback;" + lineSep + "   req.send(null);" + lineSep + "}" + lineSep + "function callback() {" + lineSep + "    if (req.readyState == 4) { " + lineSep + "        if (req.status == 200) { " + lineSep + "            var message = req.responseText;" + lineSep + "    var messageDiv = document.getElementById(\'MessageDiv\');" + lineSep + "  try {" + lineSep + "\t\t\t eval(message);" + lineSep + "    " + lineSep + "        messageDiv.innerHTML = \'Correct licence Key.\' " + lineSep + "      }" + lineSep + "  catch(err)" + lineSep + "  { " + lineSep + "    messageDiv.innerHTML = \'Wrong license key.\'" + lineSep + "} " + lineSep + "    }}}" + lineSep + "</script>" + lineSep;
    ec.addElement(new StringElement(script));
    ec.addElement(new BR().addElement(new H1().addElement("Welcome to WebGoat Registration Page:")));
    ec.addElement(new BR().addElement("Please enter the license key that was emailed to you to start using the application."));
    ec.addElement(new BR());
    ec.addElement(new BR());
    Table t1 = new Table().setCellSpacing(0).setCellPadding(0).setBorder(0).setWidth("70%").setAlign("center");
    TR tr = new TR();
    tr.addElement(new TD(new StringElement("License Key: ")));
    Input input1 = new Input(Input.TEXT, KEY, "");
    input1.setID(KEY);
    input1.addAttribute("onkeyup", "validate();");
    tr.addElement(new TD(input1));
    t1.addElement(tr);
    tr = new TR();
    tr.addElement(new TD("&nbsp;").setColSpan(2));
    t1.addElement(tr);
    tr = new TR();
    Input b = new Input();
    b.setType(Input.SUBMIT);
    b.setValue("Activate!");
    b.setName("SUBMIT");
    b.setID("SUBMIT");
    b.setDisabled(true);
    tr.addElement(new TD("&nbsp;"));
    tr.addElement(new TD(b));
    t1.addElement(tr);
    ec.addElement(t1);
    Div div = new Div();
    div.addAttribute("name", "MessageDiv");
    div.addAttribute("id", "MessageDiv");
    ec.addElement(div);
    return ec;
}

